INSERT INTO `galea_company` (`id`, `company_name`, `company_point`, `company_desc`, `mail`, `catch`, `company_password`, `people`, `money`, `agent`, `phone`, `address`, `login_switch`, `like_num`) VALUES
(3, '株式会社ECC', 2500, 'ECCはWeb技術を教える塾です。その上に、Webを特化した英語教育が特色です。英語でWeb技術を教える人材は大歓迎です。', 'ecc@ecc.com', '一番はいつもECC', '5902d83dc6c1ab24731374bf161013dd3a1966b8e42018701a13be3aba775f48', 350, 500, '田中 明夫', NULL, NULL, 0, 5),
(4, '株式会社ガレア', 2000, '株式会社ガリアはWeb業界を特化し、ビジネス英語の学習をサポートするサービスを提供する会社です。', 'galea.en@gmail.com', 'Check you skill with game.', '5902d83dc6c1ab24731374bf161013dd3a1966b8e42018701a13be3aba775f48', NULL, 150, '坂倉 正樹', '08012345678', '大阪府大阪市旭区', 0, 23),
(5, '株式会社わたし', 2200, '株式会社わたし、Webサイト制作及びWebアプリ開発をメイン業務にしている会社です。Web技術のほかに英語能力が優れたグローバル的な人材を求めています。', 'watashi@watashi.com', 'わたしの夢、ここで叶う。', '5902d83dc6c1ab24731374bf161013dd3a1966b8e42018701a13be3aba775f48', 1500, 800, '高橋　明', '06017777755', NULL, 0, 10),
(6, '株式会社ABC', 1800, 'ABCはWebアプリ及びWebシステムの開発をメイン業務にしています。英語のできるプログラマー、エンジニアを募集中です。', 'abc@abcmail.com', 'ABC、明るい明日のため', '5902d83dc6c1ab24731374bf161013dd3a1966b8e42018701a13be3aba775f48', NULL, NULL, '橋下 フジ', '06015355555', NULL, 0, 33),
(7, '株式会社ウェブウェム', 1200, 'ウェブウェムはWeb技術を生かし、多言語の通販ショッピングシステムの開発を勤めています。英語の通じるデザイナー、エンジニアを大歓迎です。', 'webwemu@web.com', 'ウェブウェム、WebでWin。', '5902d83dc6c1ab24731374bf161013dd3a1966b8e42018701a13be3aba775f48', 80, 360, '山下　景子', NULL, NULL, 0, 14),
(9, '株式会社Webソリュション', 1700, '株式会社WebソリュションはWeb翻訳サービスをメインに勤め、多言語サイトを制作する会社です。', 'websolution@solution.com', 'グローバル環境下のソリューション', '5902d83dc6c1ab24731374bf161013dd3a1966b8e42018701a13be3aba775f48', NULL, NULL, NULL, NULL, NULL, 0, 6),
(10, '株式会社みやじ', 2800, '株式会社みやじは、電子マネーサービスをメインにし、各種のWEBシステムの開発を努めています。', 'miyaji@gmail.com', 'WEBシステム開発に目指す団体!', '5902d83dc6c1ab24731374bf161013dd3a1966b8e42018701a13be3aba775f48', NULL, NULL, NULL, NULL, NULL, 0, 5),
(11, '小可能株式会社', 3000, '小可能、可能になり', 'syokano@company.com', '小可能、可能になり', '5c25e336afdbcab1f71e8384181605c5e10cf7f11b75ddb7265db03667d87e08', NULL, NULL, NULL, NULL, NULL, 0, 0),
