INSERT INTO `galea_game` (`id`, `step`, `cp_text`, `me_answer_a`, `me_answer_b`, `point`, `view`) VALUES
(1, 1, 'Please come in.', 'Good morning. I\'m Hiroki Tanaka. Thank you for inviting me in.', 'Nice to meet you. I\'m Hiroki Tanaka.', 5, 2),
(2, 1, 'Hello, Tanaka. I\'m John Anderson, the personnel manager of Galea.', 'Hello, Mr. Anderson. Thank you for giving me this opportunity to meet with you today.', 'Hello, Mr. Anderson. Thank you for giving me the chance.', 10, 2),
(3, 2, 'Good morning! How are you today?', 'I\'m doing great, thanks. I\'m really looking forward to this interview.', 'I\'m very good. And how are you?', 5, 2),
(4, 2, 'Did you have any trouble for finding the way to here?', 'No. It was easy to find. There wasn\'t much traffic on the way here.', 'No. It was really easy.', 10, 2),
(5, 2, 'What do you know about our service?', 'Galea is a web service that helps people in the IT industry learn English.', 'Sorry. I don\'t know much about your company.', 20, 2),
(6, 2, 'Do you prefer to work alone or with a team?', 'I like to work with a team because together we can do things that I cannot do alone.', 'On a team. I can borrow power from others.', 30, 2),
(7, 3, 'This is a program that counts the number of people in a seminar.', 'Excuse me, may I ask a question about it?', 'Sorry. I have a question.', 5, 1),
(8, 3, 'Of course. What\'s your question?', 'Why does this program use a while statement instead of a for statement?', 'Why don\'t you use while statement?', 10, 1),
(9, 3, '\r\nThe while statement is most appropriate for this situation. But the for statement is easier to read.', 'I understand. Thank you very much.', 'You\'re welcome.', 20, 1),
(10, 4, 'Are you getting used to working at Galea?', 'Yes, thanks to you!', 'I have a lot of things that I want to learn at Galea.', 5, 3),
(11, 4, 'That\'s great. Do you have any plans for this weekend?', 'Yes, I\'m planing to go to the beach with my family.', 'No, I have no plan.', 10, 3),
(12, 4, 'By the way, did you see the fireworks yesterday?', 'Yes, I saw them from my veranda.', 'Yes, I heard some sound from my home.', 20, 3),
(13, 4, 'You\'re lucky. It was so crowded watching them at the festival.', 'What a pain! You must be tired.', 'That\'s too bad.', 30, 3),
(14, 5, 'Excuse me, is now a good time to talk to you?', 'Yes, I\'m free now.', 'Of course. Nice to talk to you.', 5, 3),
(15, 5, 'We want to make a new logo for our company.', 'OK, what kind of logo are you thinking of?', 'I understand. Please tell me what you need to the logo?', 10, 3),
(16, 5, 'We don\'t want a color scheme that is too serious.', 'I understand, we\'ll keep that in mind.', 'I understand. Try not to be too serious.', 20, 3),
(17, 5, 'Also, we want it to be completed as soon as possible.', 'We can finish the design by next week. Thank you very much.', 'Could you please wait a little? I will check.', 30, 3),
(18, 6, 'Hello! I\'d like to book a meeting room.', 'Would you tell us your preferred room and the date?', 'Can you tell me your preferred room and the date?', 5, 2),
(19, 6, 'I\'d like a room that can seat thirty people on the morning of May 25th.', 'Ok, Let me check... I\'m afraid to tell you we\'re fully booked May 25th.', 'Ok. Let me check. We\'re fully booked May 25th. Sorry.', 10, 2),
(20, 6, 'How about May 26th?', 'Yes, we have rooms available. Would you like to have a projector in the room?', 'That\'ll be fine. Do you need a projector?', 20, 2),
(21, 7, 'That can seat thirty people on the morning of May 25.', 'Ok. Let me check. I\'m afraid to tell you we\'re fulled booked May 25.', 'Ok. Let me check. We\'re fulled booked May 25. Sorry.', 10, 2),
(22, 7, 'Ok! How about May 26.', 'That\'ll be fine. Would you like to have a project in the room?', 'That\'ll be fine. Do you need a project?', 20, 2),
(23, 8, 'Hello! I\'d like to book a meeting room.', 'Would you tell us your preferred room and the date?', 'Can you tell me your preferred room and the date?', 5, 2),
(24, 8, 'That can seat thirty people on the morning of May 25.', 'Ok. Let me check. I\'m afraid to tell you we\'re fulled booked May 25.', 'Ok. Let me check. We\'re fulled booked May 25. Sorry.', 10, 2),
(25, 8, 'Ok! How about May 26.', 'That\'ll be fine. Would you like to have a project in the room?', 'That\'ll be fine. Do you need a project?', 20, 2),
(26, 9, 'Hello! I\'d like to book a meeting room.', 'Would you tell us your preferred room and the date?', 'Can you tell me your preferred room and the date?', 2, 2),
(27, 9, 'That can seat thirty people on the morning of May 25.', 'Ok. Let me check. I\'m afraid to tell you we\'re fulled booked May 25.', 'Ok. Let me check. We\'re fulled booked May 25. Sorry.', 3, 2),
(28, 9, 'Ok! How about May 26.', 'That\'ll be fine. Would you like to have a project in the room?', 'That\'ll be fine. Do you need a project?', 5, 2),
(29, 10, 'Hello! I\'d like to book a meeting room.', 'Would you tell us your preferred room and the date?', 'Can you tell me your preferred room and the date?', 2, 2),
(30, 10, 'That can seat thirty people on the morning of May 25.', 'Ok. Let me check. I\'m afraid to tell you we\'re fulled booked May 25.', 'Ok. Let me check. We\'re fulled booked May 25. Sorry.', 3, 2),
