INSERT INTO `galea_simulation` (`id`, `view`, `lesson`, `question`, `option_a`, `option_b`, `option_c`, `option_d`, `description`, `point`) VALUES
(1, '1', 1, 'Hello, May I speak to Yamada?', 'I’m afraid he is out of office now.', 'Yes. Wait a moment.', 'Sorry, may I have your name please?', 'Would you like him to call you later?', 'ここではどういうふうに丁寧に相手が話したい人がいるかどうかを伝えるのがポイントです。<br>たとえ相手が居なくても、「I\'m afraid」など「すみません」という気持ちが含まれている言葉を使うと、相手が気持ちよく受けます。', 5),
