(151, '6', 1, 'I am very sorry, but thank you for your understanding and cooperation.', 'You are welcome.', 'I\'m sorry, I can\'t.', 'I\'m sorry, I can\'t cooperate.', 'I want to cooperation but I can\'t.', '常に相手を理解する姿勢を持つのが大事です。', 5),
(152, '6', 1, 'Please finish this design by November.', 'OK. Let me take care of that.', 'It will be done by December.', 'Can\'t you extend the deadline?', 'I\'m sorry, I can\'t.', '依頼されたときに納期を伸ばすという話をするとデメージを当たってしまうので\r\nたとえ無理と思っても、とりあえず「わかりました」と言いましょう。', 5),
(153, '6', 1, 'Excuse me. Could you please check this?', 'I understand. I\'ll check it this week.', 'Please ask a different person, not me.', 'I don\'t want to.', 'It could take long time. Is that ok?', '訂正でも大事な仕事として、ここではすぐ仕上げるということを伝えましょう。', 5),
(154, '6', 1, 'Could you do me a favor?', 'Sure! What can I do for you?', 'I don\'t have the time.', 'No. Get out of the office.', 'Tell me quickly.', '他の人に頼まれたときは、何よりも親切に手伝ってほしいことを聞きましょう。', 5),
(155, '6', 1, 'Can I run it on your server?', 'Sorry. For security reasons, that\'s impossible.', 'No, we can\'t.', 'Oh, It\'s really dangerous.', 'Ok, of course.', 'セキュリティ上で無理なことは、しっかり理由を説明して、断っていきましょう。', 5),
