INSERT INTO `galea_word` (`id`, `word`, `desc`, `lesson`, `japaness`, `type`, `option_a`, `option_b`, `option_c`, `option_d`, `question`) VALUES
(1, 'kerning', 'カタカナで書くとカーニングになります。カーニング（字送り）とは、2つの文字の間のスペース(カーン)の調整を行うことです。<br>カーニングは見る側からバランスが取っているかどうかの判断にかかわる重要な要素です。', 1, '字送り、カーニング', 0, '字送り', 'カンニング', '行送り', '行間', 'kerning'),
(2, 'alignment', 'カタカナでアラインメントと書きます。基本的は「left」(左揃え)、「center」(中央揃え)、「right」（右揃え）のことです。<br>体の機能的な並びにも使えます。', 1, '文字揃え、アラインメント', 0, 'alignment', 'aligned', 'aligning', 'align', 'Could you change the () to the left?'),
(3, 'pick out', '適当なものを選んで、拾い上げるとのことです。「選び出す」や「手に入れる」という意味もあります。', 1, 'ピックアップ、選び出す', 0, 'pick out', 'pick up', 'picking on', 'pick down', 'Please ( ) the color code.'),
(4, 'through', 'throughはある場所を通ること、ある場所を通りすぎること、信号などを突き破ることや何かの手段を通することなど、さまざまな意味を持っています。<br>問題のように、ビジネスの場では、電話を回したり、誰かと代わったりすることによく使われています。', 1, 'を通して', 0, 'through', 'on', 'out', 'to', 'Thank you for you calling. I’ll put you ( ).'),
(5, 'vertical', 'verticalは「垂直の」や「縦向きの」を表す形容詞です。「垂直にしてください」ということを言いたい場合は、「vertically」という副詞の表現を使います。', 1, '縦向き', 0, 'vertical', 'vertically', 'horizontally', 'horizontal', 'vertical'),
(6, 'variable', 'variableは「変数」の意味です。プログラムでは、変数は名前づけることで切り分けたデータを保存する入れ箱のことです。', 1, '変数', 1, '変数', '関数', '引数', '定数', 'variable'),
(7, 'update', 'アプリケーションのバージョン更新で「update」という言葉を使います。「SQL」というデータベース言語では「update」命令でデータを更新します。', 1, '更新、アップデート', 1, 'update', 'renovation', 'renewal', 'reset', '更新（アプリ）'),
(8, 'application', '「アプリケーション」は応用されたソフトのことで、「Excel」、「Word」などのことです。とくにスマートフォンに対してはアプリという略語は多く使われています。ちなみに、「software」は「hardware」の対比語で、幅広い意味を持っています。', 1, 'アプリケーション', 1, 'application', 'button', 'hardware', 'computer', 'Cloud you help me to install this ().'),
(9, 'hold onto', '「hold onto」は英語の熟語で、「預かる」という意味です。先方からもらったガイドラインや要望書などを預かるときに、使います。', 1, '預かる', 1, 'hold onto', 'hold on', 'wait for', 'hund on', 'I will ( ) this guideline book.'),
(10, 'miss', '「I miss you」のように、「〜を寂しく思う」で使うのが一般的です。エンジニアの場面では、「見逃す」という意味合いで、コードの一部を抜けたということを表します。「missing」は「抜けている」という意味です。', 1, '抜ける', 1, 'missing', 'miss', 'missed', 'lose', 'You\'re () an opening bracket here.');
INSERT INTO `galea_word_sample` (`id`, `word`, `sentence`, `japaness`) VALUES
(1, 'kerning', 'kerning is very important in design.', 'デザインでは、カーニングはとても大事です。'),
(2, 'kerning', 'Would you adjust the kerning a little more?', 'カーニングをもう少し調整してもらえますか。'),
(3, 'alignment', 'I think it looks better left-aligned.', '私は左揃えのほうが見やすいと思います。'),
(4, 'alignment', 'The alignment of my teeth isn\'t good.', '歯並びが良くないです。'),
(5, 'pick up', 'Pick out the colors to use in the design.', 'デザインで使う色をピックアップします。'),
(6, 'pick up', 'I picked out a new pair of shoes at the store.', '店で新しい靴を選んだ。'),
(7, 'through', 'I\'ll put you through to the president.', '（私を通して）社長に電話を回します。'),
(8, 'through', 'He got the job through my friend.', '彼は私の友達を通してその仕事に就いた。'),
(9, 'vertical', 'The product can be displayed both vertically and horizontally.', 'この製品は、前向きにも、横向きにも、展示することができます。'),
(10, 'vertical', 'Bottles of wine should be kept horizontal.', 'ワインのボトルは横にしておくべきです。'),
(11, 'variable', 'In JavaScript, we declare local variables with the let statement.', 'JavaScriptでは、letを使ってローカル変数を宣言します。'),
(12, 'update', 'Use the update statement to modify the new records in a table.', 'アップデート命令を使って、表にデータを更新します。'),
(13, 'update', 'I intend to update that data.', '私はそのデータを更新するつもりです。'),
(14, 'application', 'The newest version of your system supports this application.', 'そのアプリケーションは最新バージョンのシステムにサポートされています。'),
(15, 'hold onto', 'Shall I hold onto your purse for you?', 'あなたのハンドバッグを預かってあげましょうか。'),
(16, 'miss', 'He missed the train to work.', '彼は仕事に向かう電車を逃してしまった。'),
(17, 'miss', 'I think you\'ve missed the start value of the loop.', 'あなたは繰り返し処理の起点が抜けていると思います。');
